('cs5330', '<p id=\"cs5330\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5330\">CS 5330</a></span> <span class=\"course_title\">Computer Science II</span> <span class=\"course_hours\">(3 semester credit hours)</span> Bas', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5330\">CS 5330</a></span> <span class=\"course_title\">Computer Science II</span> <span class=\"course_hours\">(3 semester credit hours)</span> Basic concepts of ', 'Computer Science II', '(3 semester credit hours)', 'Basic concepts of computer organization: Numbering systems, two\'s complement notation, multi-level machine concepts, machine language, assembly programming and optimization, subroutine calls, course_addressing modes, code generation process, CPU datapath,', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5303\">CS 5303</a>', 'CS 5303', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs5333', '<p id=\"cs5333\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5333\">CS 5333</a></span> <span class=\"course_title\">Discrete Structures</span> <span class=\"course_hours\">(3 semester credit hours)</span> Mat', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5333\">CS 5333</a></span> <span class=\"course_title\">Discrete Structures</span> <span class=\"course_hours\">(3 semester credit hours)</span> Mathematical found', 'Discrete Structures', '(3 semester credit hours)', 'Mathematical foundations of computer science. Logic, sets, relations, graphs and algebraic structures. Combinatorics and metrics for performance evaluation of algorithms. Prerequisite: ENCS majors only. (3-0) S', NULL, NULL, NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs5336', '<p id=\"cs5336\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5336\">CS 5336</a></span> <span class=\"course_title\">Programming Projects in Java</span> <span class=\"course_hours\">(3 semester credit hours)</', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5336\">CS 5336</a></span> <span class=\"course_title\">Programming Projects in Java</span> <span class=\"course_hours\">(3 semester credit hours)</span> Overview ', 'Programming Projects in Java', '(3 semester credit hours)', 'Overview of the object-oriented philosophy. Implementation of object-oriented designs using the Java programming environment. Emphasis on using the browser to access and extend the Java class library. Prerequisite:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5303\">CS 5303</a>', 'CS 5303', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
