('cs5348', '<p id=\"cs5348\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5348\">CS 5348</a></span> <span class=\"course_title\">Operating Systems Concepts</span> <span class=\"course_hours\">(3 semester credit hours)</sp', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5348\">CS 5348</a></span> <span class=\"course_title\">Operating Systems Concepts</span> <span class=\"course_hours\">(3 semester credit hours)</span> Processes a', 'Operating Systems Concepts', '(3 semester credit hours)', 'Processes and threads. Concurrency issues including semaphores, monitors and deadlocks. Simple memory management. Virtual memory management. CPU scheduling algorithms. I/O management. File management. Introduction to distributed systems. Must have a worki', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5330\">CS 5330</a>', 'CS 5330', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs5349', '<p id=\"cs5349\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5349\">CS 5349</a></span> <span class=\"course_title\">Automata Theory</span> <span class=\"course_hours\">(3 semester credit hours)</span> Determi', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5349\">CS 5349</a></span> <span class=\"course_title\">Automata Theory</span> <span class=\"course_hours\">(3 semester credit hours)</span> Deterministic and nond', 'Automata Theory', '(3 semester credit hours)', 'Deterministic and nondeterministic finite automata; regular expressions, regular sets, context-free grammars, pushdown automata, context free languages. Selected topics from Turing Machines and undecidability. Prerequisite:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5333\">CS 5333</a>', 'CS 5333', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs5375', '<p id=\"cs5375\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5375\">CS 5375</a></span> <span class=\"course_title\">Principles of UNIX</span> <span class=\"course_hours\">(3 semester credit hours)</span> Desi', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5375\">CS 5375</a></span> <span class=\"course_title\">Principles of UNIX</span> <span class=\"course_hours\">(3 semester credit hours)</span> Design and history ', 'Principles of UNIX', '(3 semester credit hours)', 'Design and history of the UNIX operating system. Detailed study of process and file system data structures. Shell programming in UNIX. Use of process-forking functionality of UNIX to simplify complex problems. Interprocess communication and coordination. ', '<a href=\"https://catalog.utdallas.edu/2019/undergraduate/courses/cs3335\">CS 3335</a>', 'CS 3335', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
