('cs6314', '<p id=\"cs6314\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6314\">CS 6314</a></span> <span class=\"course_title\">Web Programming Languages</span> <span class=\"course_hours\">(3 semester credit hours)</spa', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6314\">CS 6314</a></span> <span class=\"course_title\">Web Programming Languages</span> <span class=\"course_hours\">(3 semester credit hours)</span> Advanced und', 'Web Programming Languages', '(3 semester credit hours)', 'Advanced understanding of web architecture, standards, protocols, tools, and technologies. Tools required for web programming including HTML, CSS, and JavaScript; XML and database technologies; server-side programming using PHP; Web security protocols and', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6315', '<p id=\"cs6315\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6315\">CS 6315</a></span> <span class=\"course_title\">Semantic Web</span> <span class=\"course_hours\">(3 semester credit hours)</span> History an', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6315\">CS 6315</a></span> <span class=\"course_title\">Semantic Web</span> <span class=\"course_hours\">(3 semester credit hours)</span> History and foundations o', 'Semantic Web', '(3 semester credit hours)', 'History and foundations of semantic web. URIs and namespaces; XML and XMLS Datatypes, RDF and RDF/XML, RDFS, and OWL (Lite, DL and Full); applications of semantic web; introduction to OWL 2 features and profiles; design patterns used in the creation of se', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
