('cs6325', '<p id=\"cs6325\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6325\">CS 6325</a></span> <span class=\"course_title\">Introduction to Bioinformatics</span> <span class=\"course_hours\">(3 semester credit hours)', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6325\">CS 6325</a></span> <span class=\"course_title\">Introduction to Bioinformatics</span> <span class=\"course_hours\">(3 semester credit hours)</span> The cou', 'Introduction to Bioinformatics', '(3 semester credit hours)', 'The course provides a broad overview of the bioinformatics field. Comprehensive introduction to molecular biology and molecular genetics for a program of study in bioinformatics. Discussion of elementary computer algorithms in biology (e.g., sequence alig', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6326', '<p id=\"cs6326\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6326\">CS 6326</a></span> <span class=\"course_title\">Human Computer Interactions</span> <span class=\"course_hours\">(3 semester credit hours)</s', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6326\">CS 6326</a></span> <span class=\"course_title\">Human Computer Interactions</span> <span class=\"course_hours\">(3 semester credit hours)</span> In-depth e', 'Human Computer Interactions', '(3 semester credit hours)', 'In-depth exploration of human-computer interactions (HCI). Models and principles of HCI. The user experience (UX) lifecycle and design guidelines for a wide variety of advanced interfaces, such as mobile devices and 3D sensors. UX evaluation of interface ', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6327', '<p id=\"cs6327\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6327\">CS 6327</a></span> <span class=\"course_title\">Video Analytics</span> <span class=\"course_hours\">(3 semester credit hours)</span> In-dept', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6327\">CS 6327</a></span> <span class=\"course_title\">Video Analytics</span> <span class=\"course_hours\">(3 semester credit hours)</span> In-depth analysis of t', 'Video Analytics', '(3 semester credit hours)', 'In-depth analysis of topics such as: video features for (human) activity and event detection; large-scale video event classification algorithms; objects-in-video counting approaches; multi-camera video handling; compressed video event detection and analyz', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6328', '<p id=\"cs6328\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6328\">CS 6328</a></span> <span class=\"course_title\">Modeling and Simulation</span> <span class=\"course_hours\">(3 semester credit hours)</span>', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6328\">CS 6328</a></span> <span class=\"course_title\">Modeling and Simulation</span> <span class=\"course_hours\">(3 semester credit hours)</span> Theory and pra', 'Modeling and Simulation', '(3 semester credit hours)', 'Theory and practice of modeling, including models for concepts, knowledge, geometry, and dynamics. A variety of model types are covered along with their algebraic and diagrammatic representations. Creative media design and representation of models is stre', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
