('cs6332', '<p id=\"cs6332\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6332\">CS 6332</a></span> <span class=\"course_title\">Systems Security and Malicious Code Analysis</span> <span class=\"course_hours\">(3 semester', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6332\">CS 6332</a></span> <span class=\"course_title\">Systems Security and Malicious Code Analysis</span> <span class=\"course_hours\">(3 semester credit hours)<', 'Systems Security and Malicious Code Analysis', '(3 semester credit hours)', 'Concepts, techniques, and tools to capture the structure, format, and representation of binary code, and transform them for higher level analysis. Use of static analysis including data-flow analysis, point-to analysis, and shape analysis to reason about t', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5348\">CS 5348</a>', 'CS 5348', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6333', '<p id=\"cs6333\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6333\">CS 6333</a></span> <span class=\"course_title\">Algorithms in Computational Biology</span> <span class=\"course_hours\">(3 semester credit h', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6333\">CS 6333</a></span> <span class=\"course_title\">Algorithms in Computational Biology</span> <span class=\"course_hours\">(3 semester credit hours)</span> Th', 'Algorithms in Computational Biology', '(3 semester credit hours)', 'The principles of algorithm design for biological datasets, and analysis of influential problems and techniques. Biological sequence analysis, gene finding, RNA folding, protein folding, sequence alignment, genome assembly, comparative genomics, phylogene', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6325\">CS 6325</a>', 'CS 6325', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6334', '<p id=\"cs6334\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6334\">CS 6334</a></span> <span class=\"course_title\">Virtual Reality</span> <span class=\"course_hours\">(3 semester credit hours)</span> Theory ', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6334\">CS 6334</a></span> <span class=\"course_title\">Virtual Reality</span> <span class=\"course_hours\">(3 semester credit hours)</span> Theory and practice of', 'Virtual Reality', '(3 semester credit hours)', 'Theory and practice of virtual reality (VR). Provides in-depth overview of VR, including input devices, output devices, 3D navigation techniques, 3D selection and manipulation techniques, system control techniques, interaction fidelity, scenario fidelity,', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6340', '<p id=\"cs6340\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6340\">CS 6340</a></span> <span class=\"course_title\">Wireless Networks</span> <span class=\"course_hours\">(3 semester credit hours)</span> Funda', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6340\">CS 6340</a></span> <span class=\"course_title\">Wireless Networks</span> <span class=\"course_hours\">(3 semester credit hours)</span> Fundamental techniqu', 'Wireless Networks', '(3 semester credit hours)', 'Fundamental techniques in design and operation of the 2G 4G wireless cellular networks and wireless LANs, including the control and the data planes. Introduction to future technologies, such as 5G and IoT. The course is a mix of qualitative and quantitati', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5390\">CS 5390</a>', 'CS 5390', '<a href=\"https://catalog.utdallas.edu/2019/undergraduate/courses/cs3341\">CS 3341</a>', 'CS 3341', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
