('cs6344', '<p id=\"cs6344\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6344\">CS 6344</a></span> <span class=\"course_title\">Data Representation</span> <span class=\"course_hours\">(3 semester credit hours)</span> Use', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6344\">CS 6344</a></span> <span class=\"course_title\">Data Representation</span> <span class=\"course_hours\">(3 semester credit hours)</span> Useful representat', 'Data Representation', '(3 semester credit hours)', 'Useful representations of data for efficient manipulation and visualization. These include, among others Dimensionality Reduction, Clustering, Euclidean Embedding, Graph Embedding, and Discriminant Functions. Techniques covered include principal component', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
