('cs6348', '<p id=\"cs6348\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6348\">CS 6348</a></span> <span class=\"course_title\">Data and Applications Security</span> <span class=\"course_hours\">(3 semester credit hours)', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6348\">CS 6348</a></span> <span class=\"course_title\">Data and Applications Security</span> <span class=\"course_hours\">(3 semester credit hours)</span> The cou', 'Data and Applications Security', '(3 semester credit hours)', 'The course will teach principles, technologies, tools and trends for data, and applications security and privacy. Topics to be covered include: confidentiality, privacy and trust management; advanced access control policy management; secure databases; sec', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6349', '<p id=\"cs6349\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6349\">CS 6349</a></span> <span class=\"course_title\">Network Security</span> <span class=\"course_hours\">(3 semester credit hours)</span> This c', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6349\">CS 6349</a></span> <span class=\"course_title\">Network Security</span> <span class=\"course_hours\">(3 semester credit hours)</span> This course covers th', 'Network Security', '(3 semester credit hours)', 'This course covers theoretical and practical aspects of network security. The topics include use of cryptography for building secure communication protocols and authentication systems; security handshake pitfalls, Kerberos and PKI, security of TCP/IP prot', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5390\">CS 5390</a>', 'CS 5390', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6350', '<p id=\"cs6350\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6350\">CS 6350</a></span> <span class=\"course_title\">Big Data Management and Analytics</span> <span class=\"course_hours\">(3 semester credit hou', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6350\">CS 6350</a></span> <span class=\"course_title\">Big Data Management and Analytics</span> <span class=\"course_hours\">(3 semester credit hours)</span> This', 'Big Data Management and Analytics', '(3 semester credit hours)', 'This course focuses on scalable data management and mining algorithms for analyzing very large amounts of data (i.e., Big Data). Included topics are: Mapreduce, NoSQL systems (e.g., key-value stores, column-oriented data stores, stream processing systems)', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6360\">CS 6360</a>', 'CS 6360', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6352', '<p id=\"cs6352\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6352\">CS 6352</a></span> <span class=\"course_title\">Performance of Computer Systems and Networks</span> <span class=\"course_hours\">(3 semester', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6352\">CS 6352</a></span> <span class=\"course_title\">Performance of Computer Systems and Networks</span> <span class=\"course_hours\">(3 semester credit hours)<', 'Performance of Computer Systems and Networks', '(3 semester credit hours)', 'Overview of case studies. Quick review of principles of probability theory. Queuing models and physical origin of random variables used in queuing models. Various important cases of the M/M/m/N queuing system. Little\'s law. The M/G/1 queuing system. Simul', NULL, NULL, NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6353', '<p id=\"cs6353\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6353\">CS 6353</a></span> <span class=\"course_title\">Compiler Construction</span> <span class=\"course_hours\">(3 semester credit hours)</span> L', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6353\">CS 6353</a></span> <span class=\"course_title\">Compiler Construction</span> <span class=\"course_hours\">(3 semester credit hours)</span> Lexical analyzer', 'Compiler Construction', '(3 semester credit hours)', 'Lexical analyzers, context-free grammars. Top-down and bottom-up parsing; shift reduce and LR parsing. Operator-precedence, recursive-descent, predictive, and LL parsing. LR(k), LL(k) and precedence grammars will be covered. Prerequisites:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5349\">CS 5349</a>', 'CS 5349', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6356', '<p id=\"cs6356\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6356\">CS 6356</a></span> <span class=\"course_tccns\">(<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/se6356\">SE 6356</a> and <a hr', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6356\">CS 6356</a></span> <span class=\"course_tccns\">(<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/se6356\">SE 6356</a> and <a href=\"https://cat', '(SE 6356 and SYSM 6308)', 'Software Maintenance, Evolution, and Re-Engineering', 'Principles and techniques of software maintenance. Impact of software development process on software justifiability, maintainability, evolvability, and planning of release cycles. Use of very high-level languages and dependencies for forward engineering ', NULL, NULL, NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6359', '<p id=\"cs6359\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6359\">CS 6359</a></span> <span class=\"course_title\">Object-Oriented Analysis and Design</span> <span class=\"course_hours\">(3 semester credit h', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6359\">CS 6359</a></span> <span class=\"course_title\">Object-Oriented Analysis and Design</span> <span class=\"course_hours\">(3 semester credit hours)</span> An', 'Object-Oriented Analysis and Design', '(3 semester credit hours)', 'Analysis and practice of modern tools and concepts that can help produce software that is tolerant of change. Consideration of the primary tools of encapsulation and inheritance. Construction of software-ICs which show the parallel with hardware construct', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6360', '<p id=\"cs6360\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6360\">CS 6360</a></span> <span class=\"course_title\">Database Design</span> <span class=\"course_hours\">(3 semester credit hours)</span> Methods', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6360\">CS 6360</a></span> <span class=\"course_title\">Database Design</span> <span class=\"course_hours\">(3 semester credit hours)</span> Methods, principles, a', 'Database Design', '(3 semester credit hours)', 'Methods, principles, and concepts that are relevant to the practice of database software design. Database system architecture; conceptual database models; relational and object-oriented databases; database system implementation; query processing and optim', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6361', '<p id=\"cs6361\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6361\">CS 6361</a></span> <span class=\"course_tccns\">(<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/se6361\">SE 6361</a> and <a hr', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6361\">CS 6361</a></span> <span class=\"course_tccns\">(<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/se6361\">SE 6361</a> and <a href=\"https://cat', '(SE 6361 and SYSM 6309)', 'Advanced Requirements Engineering', 'System and software requirements engineering. Identification, elicitation, modeling, analysis, specification, management, and evolution of functional and non-functional requirements. Strengths and weaknesses of different techniques, tools, and object-orie', NULL, NULL, NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6363', '<p id=\"cs6363\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6363\">CS 6363</a></span> <span class=\"course_title\">Design and Analysis of Computer Algorithms</span> <span class=\"course_hours\">(3 semester c', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6363\">CS 6363</a></span> <span class=\"course_title\">Design and Analysis of Computer Algorithms</span> <span class=\"course_hours\">(3 semester credit hours)</s', 'Design and Analysis of Computer Algorithms', '(3 semester credit hours)', 'The study of efficient algorithms for various computational problems. Algorithm design techniques. Sorting, manipulation of data structures, graphs, matrix multiplication, and pattern matching. Complexity of algorithms, lower bounds, NP completeness. Prer', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5333\">CS 5333</a>', 'CS 5333', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
