('cs6365', '<p id=\"cs6365\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6365\">CS 6365</a></span> <span class=\"course_title\">Data and Text Mining for Computational Biology</span> <span class=\"course_hours\">(3 semest', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6365\">CS 6365</a></span> <span class=\"course_title\">Data and Text Mining for Computational Biology</span> <span class=\"course_hours\">(3 semester credit hours', 'Data and Text Mining for Computational Biology', '(3 semester credit hours)', 'The course introduces data and text mining as practiced currently in the bioinformatics field. Major topics include: sequence alignment for determining similarity between proteins and genes; properties of similarities and distances; genomic, proteomic, an', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6325\">CS 6325</a>', 'CS 6325', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00');
