('cs6368', '<p id=\"cs6368\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6368\">CS 6368</a></span> <span class=\"course_title\">Telecommunication Network Management</span> <span class=\"course_hours\">(3 semester credit ', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6368\">CS 6368</a></span> <span class=\"course_title\">Telecommunication Network Management</span> <span class=\"course_hours\">(3 semester credit hours)</span> I', 'Telecommunication Network Management', '(3 semester credit hours)', 'In-depth study of network management issues and standards in telecommunication networks. OSI management protocols including CMIP, CMISE, SNMP, and MIB. ITU\'s TMN (Telecommunication Management Network) standards, TMN functional architecture and information', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5390\">CS 5390</a>', 'CS 5390', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6369', '<p id=\"cs6369\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6369\">CS 6369</a></span> <span class=\"course_title\">Complexity of Combinatorial Algorithms</span> <span class=\"course_hours\">(3 semester credi', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6369\">CS 6369</a></span> <span class=\"course_title\">Complexity of Combinatorial Algorithms</span> <span class=\"course_hours\">(3 semester credit hours)</span>', 'Complexity of Combinatorial Algorithms', '(3 semester credit hours)', 'Topics include bounded reducibility and completeness, approximation algorithms and heuristics for NP-hard problems, randomized algorithms, and additional complexity classes. Prerequisite:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6363\">CS 6363</a>', 'CS 6363', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6371', '<p id=\"cs6371\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6371\">CS 6371</a></span> <span class=\"course_title\">Advanced Programming Languages</span> <span class=\"course_hours\">(3 semester credit hours)', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6371\">CS 6371</a></span> <span class=\"course_title\">Advanced Programming Languages</span> <span class=\"course_hours\">(3 semester credit hours)</span> Functio', 'Advanced Programming Languages', '(3 semester credit hours)', 'Functional programming, Lambda calculus, logic programming, abstract syntax, denotational semantics of imperative languages, fixpoints semantics, verification of programs, partial evaluation, interpretation and automatic compilation, axiomatic semantics, ', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5349\">CS 5349</a>', 'CS 5349', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6373', '<p id=\"cs6373\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6373\">CS 6373</a></span> <span class=\"course_title\">Intelligent Systems</span> <span class=\"course_hours\">(3 semester credit hours)</span> Log', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6373\">CS 6373</a></span> <span class=\"course_title\">Intelligent Systems</span> <span class=\"course_hours\">(3 semester credit hours)</span> Logical formalizat', 'Intelligent Systems', '(3 semester credit hours)', 'Logical formalizations of knowledge for the purpose of implementing intelligent systems that can reason in a way that mimics human reasoning. Topics include: syntax and semantics of common logic, description logic, modal epistemic logic; reasoning about u', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6374', '<p id=\"cs6374\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6374\">CS 6374</a></span> <span class=\"course_title\">Computational Logic</span> <span class=\"course_hours\">(3 semester credit hours)</span> Met', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6374\">CS 6374</a></span> <span class=\"course_title\">Computational Logic</span> <span class=\"course_hours\">(3 semester credit hours)</span> Methods and algori', 'Computational Logic', '(3 semester credit hours)', 'Methods and algorithms for the solution of logic problems. Topics include problem formulation in first order logic and extensions, theorem proving algorithms, polynomially solvable cases, logic programming, and applications. Prerequisites:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6375', '<p id=\"cs6375\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6375\">CS 6375</a></span> <span class=\"course_title\">Machine Learning</span> <span class=\"course_hours\">(3 semester credit hours)</span> Algori', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6375\">CS 6375</a></span> <span class=\"course_title\">Machine Learning</span> <span class=\"course_hours\">(3 semester credit hours)</span> Algorithms for traini', 'Machine Learning', '(3 semester credit hours)', 'Algorithms for training perceptions and multi-layer neural nets: back propagation, Boltzmann machines, and self-organizing nets. The ID3 and the Nearest Neighbor algorithms. Formal models for analyzing learnability: exact identification in the limit and p', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6376', '<p id=\"cs6376\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6376\">CS 6376</a></span> <span class=\"course_title\">Parallel Processing</span> <span class=\"course_hours\">(3 semester credit hours)</span> Top', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6376\">CS 6376</a></span> <span class=\"course_title\">Parallel Processing</span> <span class=\"course_hours\">(3 semester credit hours)</span> Topics include par', 'Parallel Processing', '(3 semester credit hours)', 'Topics include parallel processing, parallel machine models, parallel algorithms for sorting, searching and matrix operations. Parallel graph algorithms. Prerequisite:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6377', '<p id=\"cs6377\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6377\">CS 6377</a></span> <span class=\"course_title\">Introduction to Cryptography</span> <span class=\"course_hours\">(3 semester credit hours)</', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6377\">CS 6377</a></span> <span class=\"course_title\">Introduction to Cryptography</span> <span class=\"course_hours\">(3 semester credit hours)</span> This cour', 'Introduction to Cryptography', '(3 semester credit hours)', 'This course covers the basic aspects of modern cryptography, including block ciphers, pseudorandom functions, symmetric encryption, Hash functions, message authentication, number-theoretic primitives, public-key encryption, digital signatures and zero kno', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5333\">CS 5333</a>', 'CS 5333', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
