('cs6379', '<p id=\"cs6379\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6379\">CS 6379</a></span> <span class=\"course_title\">Biological Database Systems and Data Mining</span> <span class=\"course_hours\">(3 semester ', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6379\">CS 6379</a></span> <span class=\"course_title\">Biological Database Systems and Data Mining</span> <span class=\"course_hours\">(3 semester credit hours)</', 'Biological Database Systems and Data Mining', '(3 semester credit hours)', 'Relational data models and database management systems; theories and techniques of constructing relational databases to store biological data, including sequences, structures, genetic linkages and maps, and signal pathways. Introduction to a relational da', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/biol6373\">BIOL 6373</a>', 'BIOL 6373', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/bmen6391\">BMEN 6391</a>', 'BMEN 6391', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6380', '<p id=\"cs6380\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6380\">CS 6380</a></span> <span class=\"course_title\">Distributed Computing</span> <span class=\"course_hours\">(3 semester credit hours)</span> T', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6380\">CS 6380</a></span> <span class=\"course_title\">Distributed Computing</span> <span class=\"course_hours\">(3 semester credit hours)</span> Topics include d', 'Distributed Computing', '(3 semester credit hours)', 'Topics include distributed algorithms, election algorithms, synchronizers, mutual exclusion, resource allocation, deadlocks, Byzantine agreement and clock synchronization, knowledge and common knowledge, reliability in distributed networks, and proving di', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5348\">CS 5348</a>', 'CS 5348', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6381', '<p id=\"cs6381\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6381\">CS 6381</a></span> <span class=\"course_title\">Combinatorics and Graph Algorithms</span> <span class=\"course_hours\">(3 semester credit ho', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6381\">CS 6381</a></span> <span class=\"course_title\">Combinatorics and Graph Algorithms</span> <span class=\"course_hours\">(3 semester credit hours)</span> Fun', 'Combinatorics and Graph Algorithms', '(3 semester credit hours)', 'Fundamentals of combinatorics and graph theory. Combinatorial optimization, optimization algorithms for graphs (max flow, shortest routes, Euler tour, Hamiltonian tour). Prerequisites:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6363\">CS 6363</a>', 'CS 6363', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
