('cs6383', '<p id=\"cs6383\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6383\">CS 6383</a></span> <span class=\"course_title\">Computational Systems Biology</span> <span class=\"course_hours\">(3 semester credit hours)<', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6383\">CS 6383</a></span> <span class=\"course_title\">Computational Systems Biology</span> <span class=\"course_hours\">(3 semester credit hours)</span> The cour', 'Computational Systems Biology', '(3 semester credit hours)', 'The course will provide a system-level understanding of biological systems by analyzing biological data using computational techniques. The major topics include: computational inference of biological networks (regulatory, protein interactions, and metabol', NULL, NULL, NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6384', '<p id=\"cs6384\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6384\">CS 6384</a></span> <span class=\"course_title\">Computer Vision</span> <span class=\"course_hours\">(3 semester credit hours)</span> Algorit', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6384\">CS 6384</a></span> <span class=\"course_title\">Computer Vision</span> <span class=\"course_hours\">(3 semester credit hours)</span> Algorithms for extract', 'Computer Vision', '(3 semester credit hours)', 'Algorithms for extracting information from digital pictures. Particular topics include: analysis of motion in time varying image sequences, recovering depth from a pair of stereo images, image separation, recovering shape from textured images and shadows,', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5343\">CS 5343</a>', 'CS 5343', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6385', '<p id=\"cs6385\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6385\">CS 6385</a></span> <span class=\"course_tccns\">(<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/te6385\">TE 6385</a>)</span> <', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6385\">CS 6385</a></span> <span class=\"course_tccns\">(<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/te6385\">TE 6385</a>)</span> <span class=\"cou', '(TE 6385)', 'Algorithmic Aspects of Telecommunication Networks', 'This is an advanced course on topics related to the design, analysis, and development of telecommunications systems and networks. The focus is on the efficient algorithmic solutions for key problems in modern telecommunications networks, in centralized an', NULL, NULL, NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6386', '<p id=\"cs6386\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6386\">CS 6386</a></span> <span class=\"course_title\">Telecommunication Software Design</span> <span class=\"course_hours\">(3 semester credit hou', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6386\">CS 6386</a></span> <span class=\"course_title\">Telecommunication Software Design</span> <span class=\"course_hours\">(3 semester credit hours)</span> Prog', 'Telecommunication Software Design', '(3 semester credit hours)', 'Programming with sockets and remote procedure calls, real time programming concepts and strategies. Operating system design for real time systems. Encryption, file compression, and implementation of fire walls. An in-depth study of TCP/IP implementation. ', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5390\">CS 5390</a>', 'CS 5390', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6390', '<p id=\"cs6390\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6390\">CS 6390</a></span> <span class=\"course_title\">Advanced Computer Networks</span> <span class=\"course_hours\">(3 semester credit hours)</sp', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6390\">CS 6390</a></span> <span class=\"course_title\">Advanced Computer Networks</span> <span class=\"course_hours\">(3 semester credit hours)</span> Survey of r', 'Advanced Computer Networks', '(3 semester credit hours)', 'Survey of recent advancements in high-speed network technologies. Application of quantitative approach to the study of broadband integrated networks including admission control, access control, and quality of service guarantee. Prerequisite:', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5390\">CS 5390</a>', 'CS 5390', NULL, NULL, '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6391', '<p id=\"cs6391\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6391\">CS 6391</a></span> <span class=\"course_title\">Optical Networks</span> <span class=\"course_hours\">(3 semester credit hours)</span> Enabli', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6391\">CS 6391</a></span> <span class=\"course_title\">Optical Networks</span> <span class=\"course_hours\">(3 semester credit hours)</span> Enabling technologies', 'Optical Networks', '(3 semester credit hours)', 'Enabling technologies for optical networks. Wavelength-division multiplexing. Broadcast-and-select optical networks. Wavelength-routed optical networks. Virtual topology design. Routing and wavelength assignment. Network control and management. Protection', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs5390\">CS 5390</a>', 'CS 5390', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6352\">CS 6352</a>', 'CS 6352', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6392', '<p id=\"cs6392\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6392\">CS 6392</a></span> <span class=\"course_title\">Mobile Computing Systems</span> <span class=\"course_hours\">(3 semester credit hours)</span', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6392\">CS 6392</a></span> <span class=\"course_title\">Mobile Computing Systems</span> <span class=\"course_hours\">(3 semester credit hours)</span> Topics includ', 'Mobile Computing Systems', '(3 semester credit hours)', 'Topics include coping with mobility of computing systems, data management, reliability issues, packet transmission, mobile IP, end-to-end reliable communication, channel and other resource allocation, slot assignment, routing protocols, and issues in mobi', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6378\">CS 6378</a>', 'CS 6378', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6390\">CS 6390</a>', 'CS 6390', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
('cs6393', '<p id=\"cs6393\"><span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6393\">CS 6393</a></span> <span class=\"course_title\">Advanced Algorithms in Biology</span> <span class=\"course_hours\">(3 semester credit hours)', '<span class=\"course_course_address\"><a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6393\">CS 6393</a></span> <span class=\"course_title\">Advanced Algorithms in Biology</span> <span class=\"course_hours\">(3 semester credit hours)</span> Recent ', 'Advanced Algorithms in Biology', '(3 semester credit hours)', 'Recent advanced topics in algorithms in biology will be discussed. Topics will be chosen from: sorting and transformational operations on strings and permutations, structural analysis of proteins, pooling design and nonadaptive group testing, approximatio', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6363\">CS 6363</a>', 'CS 6363', '<a href=\"https://catalog.utdallas.edu/2019/graduate/courses/cs6325\">CS 6325</a>', 'CS 6325', '2020-03-08 08:00:00', '2020-03-08 08:00:00'),
